Filmed at Hampton Court Palace, East Molesey, Surrey, England, UK

When her mother Liz commits suicide, 15-year-old Luci leaves the Lancashire slums to live with Liz's former lover, Robert Quayle, and his family at their posh Hampton Court home. Haunted by her mother's death and overawed by her new surroundings, Luci swings between depression and excitement, but her arrival also brings out deep-seated fears, guilt and desires within her adoptive family whom she seduces and ultimately destroys.


